// src/components/ProductList.js
import React from 'react';

const products = [
  { id: 1, name: 'Product 1', price: 100 },
  { id: 2, name: 'Product 2', price: 150 },
];

const ProductList = () => (
  <div>
    {products.map((product) => (
      <div key={product.id}>
        <h2>{product.name}</h2>
        <p>${product.price}</p>
        <button>Add to Cart</button>
      </div>
    ))}
  </div>
);

export default ProductList;
